import { NextPage } from 'next';
import GridLayout from 'react-grid-layout'

const EditDashboard: NextPage<{ userAgent: string }> = ({ userAgent }) => {
  const layout = [
    { i: () => <div style={{ backgroundColor: '#F00' }} />, x: 0, y: 0, w: 1, h: 2 },
    { i: () => <div style={{ backgroundColor: '#0F0' }} />, x: 1, y: 0, w: 3, h: 2 },
    { i: () => <div style={{ backgroundColor: '#00F' }} />, x: 4, y: 0, w: 1, h: 2}
  ]

  return (
    <GridLayout className="layout" layout={layout} cols={12} rowHeight={30} width={1200}>
      <div key="a">a</div>
      <div key="b">b</div>
      <div key="c">c</div>
    </GridLayout>
  )
};

export default EditDashboard;
